INSERT INTO `products` (`id`, `name`, `type`, `description`, `image`, `tnc`, `claim`, `brochure_file`, `workshop_file`, `workshop_count`, `deleted_at`) VALUES
(1, 'Garda Oto Comprehensive', 'comprehensive', '<p>Jaminan ganti rugi atau biaya perbaikan atas kehilangan/kerusakan sebagian maupun keseluruhan pada kendaraan yang secara langsung disebabkan oleh tabrakan, benturan, terbalik, tergelincir, terperosok, perbuatan jahat, pencurian, perampokan, kebakaran atau kecelakaan lalu lintas lainnya. (Mengacu pada Polis Standar Asuransi Kendaraan Bermotor Indonesia/ PSAKBI)</p>', '/img/garda-oto.png', '<ul><li>E-polis akan dikirim oleh Qoala setelah proses validasi selesai dilakukan dalam waktu maksimal 3 hari kerja</li><li>Usia maksimum untuk Jaminan Total Loss Only (TLO) adalah 15 tahun</li><li>Mobil Anda dinilai sesuai dengan kebijakan Asuransi Adira dan dibandingkan dengan harga pasar mobil saat ini</li><li>Asuransi tidak berlaku untuk mobil yang digunakan untuk keperluan transportasi online</li><li>Asuransi tidak berlaku untuk kendaraan yang digunakan di kawasan industri (pertambangan, perkebunan, dll)</li><li>Syarat dan ketentuan pertanggungan lengkap dapat ditemukan dalam <a href=\"https://assets.qoala.app/mv/documents/Polis-Standar-Asuransi-Kendaraan-Bermotor-Indonesia.pdf\">PSAKBI (Polis Standar Asuransi Kendaraan Bermotor Indonesia)</a></li></ul>', '<ul><li>Laporan klaim harus Anda laporkan dalam tempo 5 (lima) hari kalender sejak terjadinya kerugian</li><li>Laporan klaim dapat diajukan ke Asuransi Adira melalui telpon, e-mail atau aplikasi Autocillin Mobile Claim (lihat detail kontak di bawah)</li><li>Dokumen yang diperlukan antara lain KTP Pemegang Polis, STNK Kendaraan, SIM Pengemudi, nomor polis Asuransi Adira dan dokumen pendukung lainnya (jika diperlukan)</li><li>Untuk setiap klaim, terdapat biaya atas risiko sendiri yang harus ditanggung oleh pemegang polis. <a href=\"https://assets.qoala.app/mv/documents/ADIRA-OR-Klaim.pdf\">Klik disini untuk rinciannya</a></li></ul><p><strong>Layanan Klaim</strong></p><p>Hotline 24 Jam 1500 456<br>adiracare@asuransiadira.co.id<br>Autocillin Mobile Claim (Tersedia di Google Play Store dan iOs App Store)</p>', '/doc/ADIRA-Motor-Vehicle-Brochure.pdf', '/doc/ADIRA-List-Bengkel.pdf', 100, NULL),
(2, 'BCA Insurance Digital Comprehensive', 'comprehensive', '<p>Jaminan ganti rugi atau biaya perbaikan atas kehilangan/kerusakan sebagian maupun keseluruhan pada kendaraan yang secara langsung disebabkan oleh tabrakan, benturan, terbalik, tergelincir, terperosok, perbuatan jahat, pencurian, perampokan, kebakaran atau kecelakaan lalu lintas lainnya. (Mengacu pada Polis Standar Asuransi Kendaraan Bermotor Indonesia/ PSAKBI)</p>', '/img/bca-insurance.png', '<p>Terms and Condition</p>', '<p>Claim Description</p>', '/doc/ADIRA-Motor-Vehicle-Brochure.pdf', '/doc/ADIRA-List-Bengkel.pdf', 58, NULL),
(3, 'Mega Comprehensive', 'comprehensive', '<p>Jaminan ganti rugi atau biaya perbaikan atas kehilangan/kerusakan sebagian maupun keseluruhan pada kendaraan yang secara langsung disebabkan oleh tabrakan, benturan, terbalik, tergelincir, terperosok, perbuatan jahat, pencurian, perampokan, kebakaran atau kecelakaan lalu lintas lainnya. (Mengacu pada Polis Standar Asuransi Kendaraan Bermotor Indonesia/ PSAKBI)</p>', '/img/mega-insurance.png', '<p>Terms and Condition</p>', '<p>Claim Description</p>', '/doc/ADIRA-Motor-Vehicle-Brochure.pdf', '/doc/ADIRA-List-Bengkel.pdf', 67, NULL),
(4, 'BCA Insurance Digital Total Loss', 'tlo', '<p>Jaminan ganti rugi atas kehilangan/ kerusakan total pada kendaraan yang nilai perbaikannya mencapai minimal 75% dari harga pertanggungan yang secara langsung disebabkan oleh tabrakan, benturan, terbalik, tergelincir, terperosok, perbuatan jahat, pencurian, kebakaran, atau kecelakaan lalu lintas lainnya.</p>', '/img/bca-insurance.png', '<p>Terms and Condition</p>', '<p>Claim Description</p>', '/doc/ADIRA-Motor-Vehicle-Brochure.pdf', '/doc/ADIRA-List-Bengkel.pdf', 58, NULL),
(5, 'Sompo Total Loss', 'tlo', '<p>Jaminan ganti rugi atas kehilangan/ kerusakan total pada kendaraan yang nilai perbaikannya mencapai minimal 75% dari harga pertanggungan yang secara langsung disebabkan oleh tabrakan, benturan, terbalik, tergelincir, terperosok, perbuatan jahat, pencurian, kebakaran, atau kecelakaan lalu lintas lainnya.</p>', '/img/sompo-insurance.png', '<p>Terms and Condition</p>', '<p>Claim Description</p>', '/doc/ADIRA-Motor-Vehicle-Brochure.pdf', '/doc/ADIRA-List-Bengkel.pdf', 51, NULL),
(6, 'Produk Baru', 'comprehensive', '<p>Deskripsi</p>', '/uploads/product/afxJmvY1V8c3itKR44swf6sz1vgzE3eq.jpg', '<p>Syarat dan ketentuan</p>', '<p>Proses Klaim</p>', NULL, NULL, 11, '2022-02-11 08:46:55');
