INSERT INTO `product_features` (`id`, `product_id`, `name`, `type`, `short_description`, `description`) VALUES
(1, 1, 'Layanan Derek', 'tow', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Fasilitas derek gratis bagi Anda yang mengalami musibah saat berkendara untuk wilayah Jabodetabek, Surabaya, Bandung, Semarang, Palembang, Makassar, Medan. Untuk wilayah yang tidak terjangkau mobil derek Autocillin dan rekanan, Anda dapat mengajukan penggantian biaya derek maksimum 0.5% dari harga pertanggungan atau maksimum Rp 500 ribu per kejadian)</p>'),
(2, 1, 'Ambulans', 'ambulance', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Memberikan fasilitas ambulans bagi pengemudi dan/atau penumpang yang mengalami musibah saat berkendara, maksimum Rp 500 ribu per kejadian</p>'),
(3, 1, 'Emergency Road Assistance', 'era', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Bantuan perbaikan gratis bagi kendaraan Anda yang mengalami gangguan ringan saat berkendara di jalan (untuk wilayah Jabodetabek, Surabaya, Bandung dan Medan)</p>'),
(4, 1, 'Perbaikan pada hari yang sama (Same Day Repair)', 'other', NULL, '<ul style=\"list-style-type: disc;\"> <li>Layanan khusus dari Asuransi Adira untuk perbaikan mobil yang dilakukan pada hari yang sama di bengkel rekanan terpilih (yang telah memiliki peralatan khusus untuk perbaikan cepat).</li> <li>Kerusakan yang dapat ditangani antara lain goresan kecil, abrasi dan lecet yang tidak memerlukan ketukan, pengelasan atau penggantian suku cadang. Same day repair dapat menghilangkan goresan pada mobil dengan cepat di hari yang sama</li></ul>'),
(5, 2, 'Layanan Bantuan Darurat', 'era', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Tugu Real Experience (TREX) menyediakan layanan bantuan 24 jam yang bisa kamu manfaatkan jika ada kondisi darurat seperti ban bocor, mogok sampai kecelakaan atau membutuhkan layanan towing (mencakup wilayah Jabodetabek, Surabaya dan Medan).<br>&nbsp;Untuk wilayah yang tidak terjangkau TREX, Anda dapat mengajukan penggantian biaya derek maksimum 0.5% dari harga pertanggungan atau maksimum Rp 500 ribu per kejadian)</p>'),
(6, 2, 'Penggantian Mobil Baru', 'replace_vehicle', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Layanan ini diberikan apabila terjadi kehilangan atau kerusakan total akibat kecelakaan untuk kendaraan baru selama 6 bulan masa pertanggungan. Ganti rugi yang diberikan adalah sesuai harga baru kendaraan pada saat terjadinya kerugian.</p>'),
(7, 2, 'Garansi Perbaikan', 'repair_warranty', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Layanan ini diberikan apabila hasil perbaikan yang telah dilakukan oleh bengkel rekanan tidak memenuhi standar. Garansi perbaikan ini hanya berlaku selama 6 (enam) bulan sejak kendaraan keluar dari bengkel.</p>'),
(8, 2, 'Ambulan Gratis', 'ambulance', NULL, 'Ini Deskripsi'),
(9, 3, 'Layanan Derek', 'tow', NULL, '<p style=\'margin-top:0cm;margin-right:0cm;margin-bottom:8.0pt;margin-left:0cm;line-height:107%;font-size:15px;font-family:\"Calibri\",sans-serif;\'>Fasilitas derek gratis bagi Anda yang mengalami musibah saat berkendara untuk wilayah Jabodetabek, Surabaya, Bandung, Semarang, Palembang, Makassar, Medan. Untuk wilayah yang tidak terjangkau mobil derek Autocillin dan rekanan, Anda dapat mengajukan penggantian biaya derek maksimum 0.5% dari harga pertanggungan atau maksimum Rp 500 ribu per kejadian)</p>'),
